import React from 'react';
import { Card, CardMedia, CardContent, Typography, Grid } from '@mui/material';

const foodItems = [
  { id: 1, name: 'Veg Thali', image: 'https://via.placeholder.com/150', description: 'Delicious and healthy.' },
  { id: 2, name: 'Non-Veg Thali', image: 'https://via.placeholder.com/150', description: 'Rich in proteins and flavor.' },
];

const FoodCars = () => {
  return (
    <Grid container spacing={4} sx={{ padding: 4 }}>
      {foodItems.map((item) => (
        <Grid item xs={12} sm={6} md={4} key={item.id}>
          <Card>
            <CardMedia component="img" height="140" image={item.image} alt={item.name} />
            <CardContent>
              <Typography variant="h6">{item.name}</Typography>
              <Typography variant="body2" color="text.secondary">
                {item.description}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      ))}
    </Grid>
  );
};

export default FoodCars;
